body:
PTAL, this is a suggestion on how we could resove some of the problems that were discussed in:
https://github.com/kubernetes/dashboard/pull/79

@bryk I intentionally did not implement a "sudo" check when the local-up-cluster task is run. This could be done easily as I have already tried it out, but I am not sure if this is a hard requirement. What are your thoughts on this?

With this I can work with `kubectl proxy` clusters. Everything else
stays the same.

@taimir @zreigz Can you review?

@floreks @maciaszczykm 

I created the initial folder structure similar to the core project.

I will add content in separate PR

This commit introduces Heapster to local Kubernetes cluster. Heapster listens on port 8082:
http://localhost:8082/api/v1/model/

To check if it is up and running:
http://localhost:8082/api/v1/model/stats

```
{
  "uptime": 99,
  "stats": {
   "cpu-limit": {
    "minute": {
     "average": 8000,
     "percentile": 8000,
     "max": 8000
    },
    "hour": {
   ...........


}
```

I started working on the missing fields in the deploy view, and one of them was the ability to choose an ImagePullSecret.

This is my implementation so far. I do not know a well-established way to check if a given Docker repository is public or not. If you guys know a solution to this, I can make the ImagePullSecret field appear only when the repository is private.

@bryk could you take a look at this? Have you established a way to create a runtime resource object from a given JSON / YAML file yet? I heard you are working on the deploy from file functionality and the Secret creations might be seen as a similar topic.

I have added first links to the K8S documentation in accordance with https://github.com/kubernetes/dashboard/issues/276
Also revised some tooltip texts.

@maciaszczykm @floreks Please review

Related to #380 

I've changed approach to empty event Type issue a little. When it is not filled now, I'm adding the type based on event reason message. Also I've deleted PodEvent structure as it's not really needed. Events struct can be used instead and there is no need for additional structure.

@maciaszczykm @bryk PTAL

Open for a discussion here, because it's still raw version. What would you change? Any suggestions are appreciated.

Sample answer from http://localhost:9091/api/v1/thirdpartyresource/cron-tab.stable.example.com:
``` json

{
  "objectMeta": {
   "name": "cron-tab.stable.example.com",
   "creationTimestamp": "2017-02-20T09:05:08Z"
  },
  "typeMeta": {
   "kind": "thirdpartyresource"
  },
  "description": "A specification of a Pod to run on a cron style schedule",
  "versions": [
   {
    "name": "v1"
   }
  ],
  "objects": {
   "kind": "CronTabList",
   "apiVersion": "stable.example.com/v1",
   "metadata": {
    "selfLink": "/apis/stable.example.com/v1/crontabs",
