To check it on your own use examples from https://kubernetes.io/docs/user-guide/thirdpartyresources/.

Closes #1668.

Updated min. required go version to 1.7.1 as cross compilation for s390x platform was introduced in go 1.7.

@XiLongZheng

Previously template.ObjectMeta will always be empty, deployment will wrongly reference pod with same template.Spec.

Also
```
 	for _, rs := range allRS {	
		if EqualIgnoreHash(rs.Spec.Template, rsTemplate) {	
			**matchingPods = FilterPodsByControllerRef(&rs, allPods)**	
		}	
	}
```
if two rs has same spec only the last rs will be considered.

Done according to https://github.com/kubernetes/dashboard/wiki/Release-procedures.

Please wait for #3400.

@jeefy What is the current status of metrics container?

@kubernetes/dashboard-maintainers Most probably this is the last release before migration. What do you think about getting `ng-migration` branch merged to master then?
